INSERT INTO `fudan_hpos` VALUES ('106000', 'HP:0000005', 'Mode of inheritance', '某种特定的遗传特征或疾病，从上一代传递到下一代.', '遗传模式', '#####');
INSERT INTO `fudan_hpos` VALUES ('106001', 'HP:0001417', 'X-linked inheritance', '一种遗传模式，位于X染色体上的基因与观察到的遗传特征相关。', 'X-连锁遗传', '#####');
INSERT INTO `fudan_hpos` VALUES ('106002', 'HP:0001425', 'Heterogeneous', '#####', '异质性的', '#####');
INSERT INTO `fudan_hpos` VALUES ('106003', 'HP:0001426', 'Multifactorial inheritance', '一种遗传模式，由主要和次要的遗传因素以及可能的环境因素所决定. 以此种遗传方式遗传的疾病称为复杂疾病.', '多因素遗传', '#####');
INSERT INTO `fudan_hpos` VALUES ('106004', 'HP:0001427', 'Mitochondrial inheritance', '一种遗传模式，观察到的遗传特征与线粒体编码的基因相关。因为线粒体基因组为母系遗传，尽管疾病可以发生在男女身上，但只能通过女性传递。突变线粒体的比例可以非常不同（胞浆异质性）。', '线粒体遗传', '#####');
INSERT INTO `fudan_hpos` VALUES ('106005', 'HP:0001428', 'Somatic mutation', '#####', '体细胞突变', '#####');
INSERT INTO `fudan_hpos` VALUES ('106006', 'HP:0001442', 'Somatic mosaicism', '在特定组织内出现遗传上完全不同的体细胞群，由DNA突变，表观遗传改变，染色体畸形或遗传突变的自发性倒置引起。', '体细胞嵌合体', '#####');
INSERT INTO `fudan_hpos` VALUES ('106007', 'HP:0001444', 'Autosomal dominant somatic cell mutation', '#####', '常染色体显性体细胞突变', '#####');
INSERT INTO `fudan_hpos` VALUES ('106008', 'HP:0001450', 'Y-linked inheritance', '一种遗传模式，观察到的遗传特征与Y染色体上的基因相关。', '{{{中文译名}}}', '#####');
INSERT INTO `fudan_hpos` VALUES ('106009', 'HP:0001452', 'Autosomal dominant contiguous gene syndrome', '#####', '常染色体显性邻近基因综合征', '#####');
INSERT INTO `fudan_hpos` VALUES ('106010', 'HP:0001466', 'Contiguous gene syndrome', '#####', '邻近基因综合征', '#####');
INSERT INTO `fudan_hpos` VALUES ('106011', 'HP:0001470', 'Sex-limited autosomal dominant', '#####', '限性常染色体显性', '#####');
INSERT INTO `fudan_hpos` VALUES ('106012', 'HP:0001472', 'Familial predisposition', '#####', '家族倾向性', '#####');
INSERT INTO `fudan_hpos` VALUES ('106013', 'HP:0001475', 'Male-limited autosomal dominant', '#####', '限男性常染色体显性', '#####');
INSERT INTO `fudan_hpos` VALUES ('106014', 'HP:0003743', 'Genetic anticipation', '一种遗传模式，随着疾病从一代传递到下一代，疾病的严重程度增加或发病年龄降低。', '遗传早现', '#####');
INSERT INTO `fudan_hpos` VALUES ('106015', 'HP:0003744', 'Genetic anticipation with paternal anticipation bias', '一种遗传早现类型，主要通过男性患者传递发生。', '偏向父系传递的遗传早现', '#####');
INSERT INTO `fudan_hpos` VALUES ('106016', 'HP:0003745', 'Sporadic', '可疑疾病的发生在无家族史者的身上，例如，孤立的病例不是从父母遗传来的或没有其他的兄弟姐妹发病。', '散发的', '#####');
INSERT INTO `fudan_hpos` VALUES ('106017', 'HP:0010983', 'Oligogenic inheritance', '一种多因素遗传，由少数基因位点同时发生作用。这个术语推荐应用在由三个基因位点上，尽管需要注意的是，此术语并无统一模式。', '寡基因遗传', '#####');
INSERT INTO `fudan_hpos` VALUES ('106018', 'HP:0010984', 'Digenic inheritance', '一种多因素遗传，由两个基因位点同时发生作用。', '双基因遗传', '#####');
INSERT INTO `fudan_hpos` VALUES ('106019', 'HP:0010985', 'Gonosomal inheritance', '一种遗传模式，观察到的遗传特征与性染色体上的基因相关。', '性连锁遗传', '#####');
INSERT INTO `fudan_hpos` VALUES ('106020', 'HP:0012274', 'Autosomal dominant inheritance with paternal imprinting', '一种常染色体显性遗传的类型，涉及到的基因为父源基因沉默印记。', '父源印记基因常染色体显性遗传', '#####');
INSERT INTO `fudan_hpos` VALUES ('106021', 'HP:0012275', 'Autosomal dominant inheritance with maternal imprinting', '一种常染色体显性遗传，涉及到的基因为母源基因沉默印记。', '母源印记基因常染色体显性遗传', '#####');
