INSERT INTO `fudan_hpos` VALUES ('106320', 'HP:0012831', 'Laterality', 'The localization with respect to the side of the body of the specified phenotypic abnormality.', '偏侧性', '#####');
INSERT INTO `fudan_hpos` VALUES ('106321', 'HP:0012832', 'Bilateral', 'Being present on both sides of the body.', '双侧', '#####');
INSERT INTO `fudan_hpos` VALUES ('106322', 'HP:0012833', 'Unilateral', 'Being present on only the left or only the right side of the body.', '单侧', '#####');
