INSERT INTO `fudan_hpos` VALUES ('106340', 'HP:0030674', 'Antenatal onset', 'Onset prior to birth.', '出生前发病', '#####');
INSERT INTO `fudan_hpos` VALUES ('106341', 'HP:0001508', 'Failure to thrive', 'Failure to thrive (FTT) refers to a child whose physical growth is substantially below the norm.', '不能生长发育', '不能生长发育（FTT）是指孩子的身体生长明显低于正常。');
