INSERT INTO `fudan_hpos` VALUES ('106395', 'HP:0011415', 'Calcified placenta', 'Calcification placenta refers to the placenta with calcium deposits on .', '胎盘钙化', '胎盘钙化指胎盘上存在钙质沉积。');
