INSERT INTO `fudan_hpos` VALUES ('106403', 'HP:0100558', 'Hemiatrophy of upper limb', 'Unilateral atrophy (reduction in size) of an arm.', '上肢偏侧萎缩', '单侧胳膊发生萎缩（体积减小）。');
