INSERT INTO `fudan_hpos` VALUES ('106412', 'HP:0030246', 'Maternal first trimester fever', 'The occurence of fever in a mother during the first trimester of pregnancy.', '妊娠早期孕妇发烧', '#####');
INSERT INTO `fudan_hpos` VALUES ('106413', 'HP:0030654', 'Umbilical cord cyst', 'Any cystic lesion associated with the umbilical cord.', '脐带囊肿', '#####');
