INSERT INTO `fudan_hpos` VALUES ('106420', 'HP:0030753', 'Intrauterine fetal demise of one twin after midgestation', 'Loss of one twin occurring after midgestation (17 weeks gestation).', '妊娠中期之后双胞胎之一宫内胎儿死亡', '#####');
INSERT INTO `fudan_hpos` VALUES ('106421', 'HP:0040222', 'Maternal thrombophilia', 'An increased tendency towards thrombosis in the mother during a pregnancy.', '妊娠期高凝状态，妊娠期血栓形成倾向', '#####');
