INSERT INTO `fudan_hpos` VALUES ('107002', 'HP:0011252', 'Cryptotia', 'Invagination of the superior part of the auricle under a fold of temporal skin.', '隐耳', '耳廓软骨上端的突起隐入颞部头皮的皱襞皮下。');
