INSERT INTO `fudan_hpos` VALUES ('107010', 'HP:0011270', 'Duplicated tragus', 'A complete or partial duplication of the tragus; expected to lie anterior to the normal tragus.', '双耳屏', '耳屏完全或者部分的重复，部分位于正常耳屏的前方。');
