INSERT INTO `fudan_hpos` VALUES ('107374', 'HP:0000097', 'Focal segmental glomerulosclerosis', 'Segmental accumulation of scar tissue in individual (but not all) glomeruli.', '局灶节段性肾小球硬化', '在部分（而不是全部）肾小球存在节段性瘢痕组织增加。');
INSERT INTO `fudan_hpos` VALUES ('107375', 'HP:0000099', 'Glomerulonephritis', 'Inflammation of the renal glomeruli.', '肾小球肾炎', '肾小球的炎症。');
INSERT INTO `fudan_hpos` VALUES ('107376', 'HP:0000103', 'Polyuria', 'An `increased rate` (PATO:0000912) of urine production.', '多尿', '尿液生成率增加。');
INSERT INTO `fudan_hpos` VALUES ('107377', 'HP:0000105', 'Enlarged kidneys', 'An abnormal increase in the size of the kidney.', '肾脏增大', '肾脏的大小异常增加。');
INSERT INTO `fudan_hpos` VALUES ('107378', 'HP:0000107', 'Renal cyst', 'A fluid filled sac in the kidney.', '肾囊肿', '肾脏中有充满液体的囊。');
INSERT INTO `fudan_hpos` VALUES ('107379', 'HP:0000108', 'Renal corticomedullary cysts', 'The presence of multiple cysts at the border between the renal cortex and medulla.', '肾皮髓质交界处囊肿', '肾皮质和髓质交界处多发性囊肿。');
INSERT INTO `fudan_hpos` VALUES ('107380', 'HP:0000110', 'Renal dysplasia', 'The presence of `developmental dysplasia` (MPATH:64) of the `kidney` (FMA:7203).', '肾发育不良', '肾脏发育不良。');
INSERT INTO `fudan_hpos` VALUES ('107381', 'HP:0000111', 'Renal juxtaglomerular cell hypertrophy/hyperplasia', 'Increased number and size of the juxtaglomerular cells.', '肾小球球旁细胞肥大/增生', '肾小球球旁细胞数量增加和体积增大。');
INSERT INTO `fudan_hpos` VALUES ('107382', 'HP:0000112', 'Nephropathy', 'A nonspecific term referring to disease or damage of the kidneys.', '肾病', '非特异性术语​​，通指肾脏的疾病或损伤。');
INSERT INTO `fudan_hpos` VALUES ('107383', 'HP:0000113', 'Polycystic kidney dysplasia', 'The presence of multiple cysts in both kidneys.', '多囊性肾发育不良', '双侧肾脏多发囊肿。');
INSERT INTO `fudan_hpos` VALUES ('107384', 'HP:0000117', 'Renal phosphate wasting', 'High urine phosphate in the presence of hypophosphatemia.', '肾源性磷酸盐丢失', '尿液中高磷酸盐，发生低磷血症。');
INSERT INTO `fudan_hpos` VALUES ('107385', 'HP:0000119', 'Abnormality of the genitourinary system', 'The presence of any abnormality of the `genitourinary system` (FMA:280610).', '泌尿生殖系统异常', '泌尿生殖系统的异常。');
INSERT INTO `fudan_hpos` VALUES ('107386', 'HP:0000121', 'Nephrocalcinosis', 'Nephrocalcinosis is the deposition of calcium salts in renal parenchyma.', '肾钙质沉着症', '肾钙质沉着症指是钙盐在肾实质的沉积。');
INSERT INTO `fudan_hpos` VALUES ('107387', 'HP:0000122', 'Unilateral renal agenesis', 'A `unilateral` (PATO:0000634) form of `agenesis` (MPATH:57) of the `kidney` (FMA:7203).', '单侧肾缺如', '单侧型肾缺如。');
INSERT INTO `fudan_hpos` VALUES ('107388', 'HP:0000123', 'Nephritis', 'The presence of `inflammation` (MPATH:212) affecting the `kidney` (FMA:7203).', '肾炎', '肾脏出现炎症反应。');
INSERT INTO `fudan_hpos` VALUES ('107389', 'HP:0000124', 'Renal tubular dysfunction', '#####', '肾小管功能障碍', '#####');
INSERT INTO `fudan_hpos` VALUES ('107390', 'HP:0000126', 'Hydronephrosis', 'Severe distention of the kidney with dilation of the renal pelvis and calices.', '肾积水', '肾脏严重扩张伴肾盂和肾盏扩张。');
INSERT INTO `fudan_hpos` VALUES ('107391', 'HP:0000128', 'Renal potassium wasting', 'High urine potassium in the presence of hypokalemia.', '肾源性钾丢失', '尿液高钾，发生低钾血症。');
INSERT INTO `fudan_hpos` VALUES ('107392', 'HP:0000130', 'Abnormality of the uterus', 'An abnormality of the `uterus` (FMA:17558).', '子宫异常', '子宫的异常。');
INSERT INTO `fudan_hpos` VALUES ('107393', 'HP:0000131', 'Uterine leiomyoma', 'The presence of a `leiomyoma` (MPATH:425) of the `uterus` (FMA:17558).', '子宫平滑肌瘤', '子宫发生平滑肌瘤。');
INSERT INTO `fudan_hpos` VALUES ('107394', 'HP:0000132', 'Menorrhagia', 'Abnormally heavy and prolonged menstrual period.', '月经过多', '月经异常增多和经期延长。');
INSERT INTO `fudan_hpos` VALUES ('107395', 'HP:0000133', 'Gonadal dysgenesis', '#####', '性腺发育不全', '#####');
INSERT INTO `fudan_hpos` VALUES ('107396', 'HP:0000134', 'Female hypogonadism', '`Decreased functionality` (PATO:0001624) of the female gonads, i.e., of the `ovary` (FMA:7209).', '女性性腺功能低下', '女性的性腺即卵巢功能减退。');
INSERT INTO `fudan_hpos` VALUES ('107397', 'HP:0000135', 'Hypogonadism', 'A `decreased functionality` (PATO:0001624) of the `gonad` (FMA:18250).', '性腺功能低下', '性腺的功能下降。');
INSERT INTO `fudan_hpos` VALUES ('107398', 'HP:0000136', 'Bifid uterus', 'The presence of a `bifid` (PATO:0001572) `uterus` (FMA:17558).', '双角子宫', '子宫分裂成两半。');
INSERT INTO `fudan_hpos` VALUES ('107399', 'HP:0000137', 'Abnormality of the ovary', 'An abnormality of the `ovary` (FMA:7209).', '卵巢异常', '卵巢的异常。');
INSERT INTO `fudan_hpos` VALUES ('107400', 'HP:0000138', 'Ovarian cyst', 'The presence of one or more `cysts` (MPATH:62) of the `ovary` (FMA:7209).', '卵巢囊肿', '卵巢有一个或多个囊肿。');
INSERT INTO `fudan_hpos` VALUES ('107401', 'HP:0000139', 'Uterine prolapse', 'The presence of `prolapse` (MPATH:626) of the `uterus` (FMA:17558).', '子宫脱垂', '子宫发生脱垂。');
INSERT INTO `fudan_hpos` VALUES ('107402', 'HP:0000140', 'Abnormality of the menstrual cycle', 'An abnormality of the `ovulation cycle` (GO:0042698).', '月经周期异常', '排卵周期的异常。');
INSERT INTO `fudan_hpos` VALUES ('107403', 'HP:0000141', 'Amenorrhea', '#####', '闭经', '#####');
INSERT INTO `fudan_hpos` VALUES ('107404', 'HP:0000142', 'Abnormality of the vagina', 'An abnormality of the `vagina` (FMA:19949).', '阴道异常', '阴道的异常。');
INSERT INTO `fudan_hpos` VALUES ('107405', 'HP:0000144', 'Decreased fertility', '#####', '生育能力下降', '#####');
INSERT INTO `fudan_hpos` VALUES ('107406', 'HP:0000145', 'Transverse vaginal septum', '#####', '阴道横膈', '#####');
INSERT INTO `fudan_hpos` VALUES ('107407', 'HP:0000147', 'Polycystic ovaries', '#####', '多囊卵巢', '#####');
INSERT INTO `fudan_hpos` VALUES ('107408', 'HP:0000148', 'Vaginal atresia', 'Congenital occlusion of the vagina or adhesion of the walls of the vagina causing occlusion.', '阴道闭锁', '阴道先天闭塞或阴道壁粘连造成闭锁。');
INSERT INTO `fudan_hpos` VALUES ('107409', 'HP:0000149', 'Ovarian gonadoblastoma', 'The presence of a `gonadoblastoma` (MPATH:315) of the `ovary` (FMA:7209).', '卵巢性腺母细胞瘤', '卵巢中存在性腺母细胞瘤。');
INSERT INTO `fudan_hpos` VALUES ('107410', 'HP:0000151', 'aplasia of the uterus', '`Aplasia` (MPATH:58) of the `uterus` (FMA:17558).', '子宫发育不全', '子宫发育不全。');
INSERT INTO `fudan_hpos` VALUES ('107411', 'HP:0000786', 'Primary amenorrhea', '#####', '原发性闭经', '#####');
INSERT INTO `fudan_hpos` VALUES ('107412', 'HP:0000787', 'Nephrolithiasis', 'The presence of calculi (stones) in the kidneys.', '肾结石', '肾脏中有结石（石头）。');
INSERT INTO `fudan_hpos` VALUES ('107413', 'HP:0000789', 'Infertility', '#####', '不育症', '#####');
INSERT INTO `fudan_hpos` VALUES ('107414', 'HP:0000791', 'Uric acid nephrolithiasis', 'The presence of uric acid-containing calculi (stones) in the kidneys.', '肾尿酸结石', '肾脏发生含尿酸的结石。');
INSERT INTO `fudan_hpos` VALUES ('107415', 'HP:0000794', 'IgA deposition in the glomerulus', 'The presence of immunoglobulin A deposits in the glomerulus.', '肾小球IgA沉积', '免疫球蛋白A沉积在肾小球中。');
INSERT INTO `fudan_hpos` VALUES ('107416', 'HP:0000796', 'Urethral obstruction', 'Obstruction of the flow of urine through the `urethra` (FMA:19667).', '尿道梗阻', '尿流通过尿道时发生阻塞。');
INSERT INTO `fudan_hpos` VALUES ('107417', 'HP:0000799', 'Renal steatosis', 'Abnormal fat accumulation in the kidneys.', '肾脂肪变性', '肾脏脂肪异常堆积。');
INSERT INTO `fudan_hpos` VALUES ('107418', 'HP:0000800', 'Cystic renal dysplasia', '#####', '囊性肾发育不良', '#####');
INSERT INTO `fudan_hpos` VALUES ('107419', 'HP:0000802', 'Impotence', 'Inability to develop or maintain an erection of the penis.', '阳痿', '不能启动和维持阴茎勃起。');
INSERT INTO `fudan_hpos` VALUES ('107420', 'HP:0000803', 'Renal cortical cysts', 'Cysts of the `cortex of the kidney` (FMA:15581).', '肾皮质囊肿', '肾皮质发生囊肿。');
INSERT INTO `fudan_hpos` VALUES ('107421', 'HP:0000804', 'Xanthine nephrolithiasis', 'The presence of xanthine-containing calculi (stones) in the kidneys.', '肾黄嘌呤结石', '肾脏中有含黄嘌呤的结石（石头）。');
INSERT INTO `fudan_hpos` VALUES ('107422', 'HP:0000807', 'Glandular hypospadias', '#####', '尿道下裂', '#####');
INSERT INTO `fudan_hpos` VALUES ('107423', 'HP:0000809', 'Urinary tract atresia', 'Congenital absence of the normal opening of a structure of the urinary tract.', '尿道闭锁', '先天性没有尿道结构的正常开口。');
INSERT INTO `fudan_hpos` VALUES ('107424', 'HP:0000811', 'Abnormal external genitalia', '#####', '外生殖器异常', '#####');
INSERT INTO `fudan_hpos` VALUES ('107425', 'HP:0000812', 'Abnormal internal genitalia', 'An anomaly of the adnexa, uterus, and vagina (in female) or seminal tract and prostate (in male).', '内生殖器异常', '女性的附件、子宫和阴道或男性的输精管和前列腺的异常。');
INSERT INTO `fudan_hpos` VALUES ('107426', 'HP:0000813', 'Bicornuate uterus', 'The presence of a `bicornuate` (PATO:0002161) `uterus` (FMA:17558).', '双角子宫', '副中肾管的尾端发育障碍,致使内生殖器成为单宫颈、单阴道,而子宫底部呈双角形,故称双角子宫或鞍状子宫。');
INSERT INTO `fudan_hpos` VALUES ('107427', 'HP:0000868', 'Decreased fertility in females', '#####', '女性生育能力降低', '#####');
INSERT INTO `fudan_hpos` VALUES ('107428', 'HP:0000869', 'Secondary amenorrhea', '#####', '继发性闭经', '#####');
INSERT INTO `fudan_hpos` VALUES ('107429', 'HP:0000876', 'Oligomenorrhea', 'Infrequent periods (less than 6 per year).', '月经稀发', '月经次数减少（每年少于6次）。');
INSERT INTO `fudan_hpos` VALUES ('107430', 'HP:0001587', 'Primary ovarian failure', 'Malfunctioning of the ovaries such that a girl never begins menstruation.', '原发性卵巢功能衰竭', '卵巢功能异常，使女孩从未发生月经来潮。');
INSERT INTO `fudan_hpos` VALUES ('107431', 'HP:0001741', 'Phimosis', 'The male foreskin cannot be fully retracted from the head of the penis.', '包茎', '男性的包皮不能完全从龟头后缩（让龟头露出来）。');
INSERT INTO `fudan_hpos` VALUES ('107432', 'HP:0001827', 'Genital tract atresia', 'Congenital occlusion of a tube in the genital tract.', '生殖道闭锁', '生殖道的先天性管道闭塞。');
INSERT INTO `fudan_hpos` VALUES ('107433', 'HP:0001917', 'Renal amyloidosis', 'A form of `amyloidosis` (HP:0011034) that affects the `kidney` (FMA:7203).', '肾脏淀粉样变', '淀粉样变累及了肾。');
INSERT INTO `fudan_hpos` VALUES ('107434', 'HP:0001920', 'Renal artery stenosis', 'The presence of `stenosis` (MPATH:80) of the `renal artery` (FMA:14751).', '肾动脉狭窄', '肾动脉发生狭窄。');
INSERT INTO `fudan_hpos` VALUES ('107435', 'HP:0001969', 'Tubulointerstitial abnormality', 'An abnormality that involves the tubules and interstitial tissue of the kidney.', '肾小管间质异常', '涉及肾小管和肾间质组织的异常。');
INSERT INTO `fudan_hpos` VALUES ('107436', 'HP:0001992', 'Organic aciduria', 'Excretion of non-amino organic acids in urine.', '有机酸尿症', '尿液中非氨基有机酸排泄增加。');
INSERT INTO `fudan_hpos` VALUES ('107437', 'HP:0002048', 'Renal cortical atrophy', '`Atrophy` (MPATH:127) of the `cortex of the kidney` (FMA:15581).', '肾皮质萎缩', '肾皮质萎缩。');
INSERT INTO `fudan_hpos` VALUES ('107438', 'HP:0002050', 'Macroorchidism, postpubertal', '#####', '青春期后大睾丸', '#####');
INSERT INTO `fudan_hpos` VALUES ('107439', 'HP:0002150', 'Hypercalciuria', '#####', '高钙尿症', '#####');
INSERT INTO `fudan_hpos` VALUES ('107440', 'HP:0002156', 'Homocystinuria', 'An increased concentration of `homocystine` (CHEBI:17485) in the `urine` (FMA:12274).', '高胱氨酸尿症', '尿液中胱氨酸浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107441', 'HP:0002839', 'Urinary bladder sphincter dysfunction', 'Abnormal function of a sphincter of the `urinary bladder` (FMA:15900).', '膀胱括约肌功能障碍', '膀胱括约肌功能异常。');
INSERT INTO `fudan_hpos` VALUES ('107442', 'HP:0002862', 'Bladder carcinoma', 'The presence of a `carcinoma` (MPATH:549) of the `urinary bladder` (FMA:15900).', '膀胱癌', '膀胱发生的癌症。');
INSERT INTO `fudan_hpos` VALUES ('107443', 'HP:0002891', 'Uterine leiomyosarcoma', 'The presence of a `leiomyosarcoma` (MPATH:426) of the `uterus` (FMA:17558).', '子宫平滑肌肉瘤', '子宫发生的平滑肌肉瘤。');
INSERT INTO `fudan_hpos` VALUES ('107444', 'HP:0002907', 'Microscopic hematuria', 'Microscopic hematuria detected by dipstick or microscopic examination of the urine.', '镜下血尿', '通过试纸（dipstick）或显微镜检查可发现的血尿。');
INSERT INTO `fudan_hpos` VALUES ('107445', 'HP:0002909', 'Generalized aminoaciduria', 'An increased concentration of all types of `amino acid` (CHEBI:33709 ) in the `urine` (FMA:12274).', '全谱氨基酸尿症', '尿中出现全谱氨基酸的浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107446', 'HP:0002913', 'Myoglobinuria', 'Presence of `myoglobin` (CHEBI:7044) in the urine.', '肌红蛋白尿症', '尿中存在肌红蛋白。');
INSERT INTO `fudan_hpos` VALUES ('107447', 'HP:0002914', 'Hyperchloridura', 'An increased concentration of `chloride` (CHEBI:17996) in the `urine` (FMA:12274).', '高氯尿症', '尿液中氯化物浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107448', 'HP:0002919', 'Ketonuria', 'High levels of ketone bodies in the urine.', '酮尿', '尿中出现酮体。');
INSERT INTO `fudan_hpos` VALUES ('107449', 'HP:0002927', 'Histidinuria', 'An increased concentration of `histidine` (CHEBI:27570) in the `urine` (FMA:12274).', '组氨酸尿症', '尿液中组氨酸浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107450', 'HP:0003076', 'Glycosuria', 'An `increased concentration` (PATO:0001162) of `glucose` (CHEBI:17234) in the `urine` (FMA:12274).', '糖尿', '尿液中葡萄糖的浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107451', 'HP:0003080', 'Hydroxyprolinuria', 'An increased concentration of `4-hydroxy-L-proline` (CHEBI:18240) the `urine` (FMA:12274).', '羟脯氨酸尿症', '尿中4-羟基-L-脯氨酸的浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107452', 'HP:0003081', 'Increased urinary potassium', 'An increased concentration of `potassium(1+)` (CHEBI:29103) in the `urine` (FMA:12274).', '尿钾增加', '尿液中钾离子(1+)的浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107453', 'HP:0003108', 'Hyperglycinuria', 'An increased concentration of `glycine` (CHEBI:15428 ) in the `urine` (FMA:12274).', '高甘氨酸尿症', '尿液中甘氨酸浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107454', 'HP:0003109', 'Hyperphosphaturia', 'An increased excretion of phosphates in the urine.', '高磷酸盐尿症', '尿液中磷酸盐的排泄增加。');
INSERT INTO `fudan_hpos` VALUES ('107455', 'HP:0003110', 'Abnormality of urine homeostasis', 'An abnormality of the composition of urine or the levels of its components.', '尿液内平衡异常', '尿液中各组分构成或各自水平的异常。');
INSERT INTO `fudan_hpos` VALUES ('107456', 'HP:0003126', 'Low-molecular-weight proteinuria', 'Excretion in urine of proteins of a size smaller than albumin (molecular weight 69 kD).', '低分子量蛋白尿症', '从尿中排出分子量小于白蛋白（分子量为69 KD）的低分子蛋白。');
INSERT INTO `fudan_hpos` VALUES ('107457', 'HP:0003127', 'Hypocalciuria', 'An abnormally decreased `calcium` (CHEBI:29108) concentration in the urine (FMA:12274).', '低钙尿症', '尿液中的钙离子浓度异常降低。');
INSERT INTO `fudan_hpos` VALUES ('107458', 'HP:0003131', 'Cystinuria', 'An increased concentration of `cystine` (CHEBI:17376) in the `urine` (FMA:12274).', '胱氨酸尿症', '尿中胱氨酸浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107459', 'HP:0003137', 'Prolinuria', 'An increased concentration of `proline` (CHEBI:26271) in the `urine` (FMA:12274).', '脯氨酸尿症', '尿液中脯氨酸浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107460', 'HP:0003149', 'Hyperuricosuria', 'An abnormally high level of `uric acid` (CHEBI:27226) in the `urine` (FMA:12274).', '高尿酸尿症', '尿液中尿酸水平异常增高。');
INSERT INTO `fudan_hpos` VALUES ('107461', 'HP:0003150', 'Glutaric aciduria', 'An increased concentration of `glutaric acid` (CHEBI:17859) in the `urine` (FMA:12274).', '戊二酸尿症', '尿液中戊二酸的浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107462', 'HP:0003153', 'Cystathioninuria', 'An elevated urinary concentration of `cystathionine` (CHEBI:17755).', '胱硫醚尿症', '尿中胱硫醚浓度升高。');
INSERT INTO `fudan_hpos` VALUES ('107463', 'HP:0003158', 'Hyposthenuria', 'An abnormally low urinary specific gravity, i.e., reduced concentration of solutes in the urine.', '低渗尿症', '尿比重异常低，即尿中溶质的浓度降低。');
INSERT INTO `fudan_hpos` VALUES ('107464', 'HP:0003159', 'Hyperoxaluria', 'Increased excretion of oxalates in the urine.', '高草酸尿症', '尿液中草酸盐的排泄增加。');
INSERT INTO `fudan_hpos` VALUES ('107465', 'HP:0003161', '4-Hydroxyphenylpyruvic aciduria', 'Increased concentration of `(4-hydroxyphenyl)pyruvic acid` (CHEBI:15999) in the urine.', '4-羟基苯丙酮酸尿症', '尿中4-羟基苯丙酮酸(CHEBI:15999)浓度升高。');
INSERT INTO `fudan_hpos` VALUES ('107466', 'HP:0003166', 'Increased urinary taurine', 'Increased concentration of `taurine` (CHEBI:15891) in the `urine` (FMA:12274).', '尿牛磺酸增加', '尿液中牛磺酸浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107467', 'HP:0003167', 'Carnosinuria', 'An increased concentration of `carnosine` (CHEBI:15727) in the `urine` (FMA:12274).', '肌肽尿症', '尿内肌肽浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107468', 'HP:0003168', 'Dibasicaminoaciduria', '#####', '双碱基氨基酸尿症', '#####');
INSERT INTO `fudan_hpos` VALUES ('107469', 'HP:0003215', 'Dicarboxylic aciduria', 'An increased concentration of `dicarboxylic acid` (CHEBI:35692) in the `urine` (FMA:12274).', '二羧酸尿症', '尿液中二羧酸浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107470', 'HP:0003219', 'Ethylmalonic aciduria', 'An increased concentration of `ethylmalonic acid` (CHEBI:741548) in the `urine` (FMA:12274).', '乙基丙二酸尿症', '尿液中乙基丙二酸浓度增加。');
INSERT INTO `fudan_hpos` VALUES ('107471', 'HP:0003239', 'Phosphoethanolaminuria', 'An increased concentration of ` phosphoethanolamine` (CHEBI:36711) in the `urine` (FMA:12274).', '磷酸乙醇胺尿症', '尿液中磷酸乙醇胺浓度增加。');
