INSERT INTO `fudan_hpos` VALUES ('111939', 'HP:0010756', 'aplasia/Hypoplasia of the premaxilla', 'Absence or underdevelopment of the `premaxilla` (FMA:76869).', '前上颌骨发育不全／未发育', '没有或发育不全的前颌骨。');
INSERT INTO `fudan_hpos` VALUES ('111940', 'HP:0010758', 'Abnormality of the premaxilla', 'An abnormality of the `premaxilla` (FMA:76869).', '前上颌骨异常', '前颌骨的异常。');
