INSERT INTO `fudan_hpos` VALUES ('111949', 'HP:0010808', 'Protruding tongue', 'Tongue extending beyond the alveolar ridges or teeth at rest.', '舌头过长', '舌在休息位时超出牙槽脊或牙齿。');
INSERT INTO `fudan_hpos` VALUES ('111950', 'HP:0010809', 'Broad uvula', 'Increased width of the `uvula` (FMA:55022) (subjective finding).', '宽悬雍垂', '悬雍垂宽度增加（主观发现）');
INSERT INTO `fudan_hpos` VALUES ('111951', 'HP:0010810', 'Long uvula', 'Increased length of the `uvula` (FMA:55022).', '长悬雍垂', '悬雍垂的长度增加。');
INSERT INTO `fudan_hpos` VALUES ('111952', 'HP:0010811', 'Narrow uvula', 'Decreased width of the `uvula` (FMA:55022).', '悬雍垂狭窄', '悬雍垂宽度减少。');
INSERT INTO `fudan_hpos` VALUES ('111953', 'HP:0010812', 'Short uvula', 'Decreased length of the uvula.', '悬雍垂短小', '悬雍垂长度减少。');
INSERT INTO `fudan_hpos` VALUES ('111954', 'HP:0010823', 'Ridged cranial sutures', 'An overlap of the bony plates of the skull in an infant, with or without early closure.', '脊颅缝', '婴儿颅骨骨板的重叠，伴或不伴早闭。');
INSERT INTO `fudan_hpos` VALUES ('111955', 'HP:0010826', 'Abnormality of the twelfth cranial nerve', 'Abnormality of the `twelfth cranial nerve` (FMA:50871).', '第十二颅神经异常', '在\'第十二颅神经`异常（FMA:50871）。');
INSERT INTO `fudan_hpos` VALUES ('111956', 'HP:0010879', 'Postnatal cystic hygroma', '#####', '出生后囊状水瘤', '#####');
INSERT INTO `fudan_hpos` VALUES ('111957', 'HP:0010937', 'Abnormality of the nasal skeleton', 'An abnormality of the `nasal skeleton` (FMA:60116).', '鼻骨架异常', '鼻骨架的异常。');
INSERT INTO `fudan_hpos` VALUES ('111958', 'HP:0010938', 'Abnormality of the external nose', 'An abnormality of the `external nose` (FMA:59515).', '外鼻异常', '外鼻的异常。');
INSERT INTO `fudan_hpos` VALUES ('111959', 'HP:0010940', 'aplasia/Hypoplasia of the nasal bone', 'Absence or underdevelopment of the `nasal bone` (FMA:52745).', '鼻骨发育不全／未发育', '没有或发育不全的鼻骨。');
INSERT INTO `fudan_hpos` VALUES ('111960', 'HP:0010941', 'aplasia of the nasal bone', 'Absence of the `nasal bone` (FMA:52745).', '鼻骨未发育', '没有鼻骨。');
INSERT INTO `fudan_hpos` VALUES ('111961', 'HP:0011006', 'Abnormality of the musculature of the neck', 'An abnormality of the `neck musculature` (FMA:71290).', '颈部肌肉异常', '颈部肌肉的异常。');
INSERT INTO `fudan_hpos` VALUES ('111962', 'HP:0011044', 'Abnormal number of permanent teeth', 'The presence of an `altered number of` of `permanent teeth`', '恒牙数目异常', '恒牙的数目改变。');
INSERT INTO `fudan_hpos` VALUES ('111963', 'HP:0011045', 'Agenesis of permanent maxillary central incisor', '`Agenesis` (MPATH:57) of `upper secondary incisor` (FMA:55712).', '恒上颌中切牙发育不全', '恒上颌中切牙发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111964', 'HP:0011046', 'Agenesis of primary maxillary central incisor', '`Agenesis` (MPATH:57) of `upper central primary incisor` (FMA:84216).', '乳上颌中切牙发育不全', '乳上颌中切牙发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111965', 'HP:0011047', 'Agenesis of primary mandibular central incisor', '`Agenesis` (MPATH:57) of `lower primary incisor` (FMA:84215).', '乳下颌中切牙发育不全', '乳下颌中切牙发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111966', 'HP:0011048', 'Agenesis of permanent mandibular central incisor', '`Agenesis` (MPATH:57) of `lower secondary incisor` (FMA:55713).', '恒下颌中切牙发育不全', '恒下颌中切牙发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111967', 'HP:0011050', 'Agenesis of permanent maxillary lateral incisor', '`Agenesis` (MPATH:57) of one or more `upper lateral secondary incisor` (FMA:55724).', '恒上颌侧切牙发育不全', '一个或多个恒上颌侧切牙发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111968', 'HP:0011051', 'Agenesis of premolar', '`Agenesis` (MPATH:57) of `premolar tooth` (FMA:55637).', '小臼齿发育不全', '小臼齿发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111969', 'HP:0011052', 'Agenesis of maxillary premolar', '`Agenesis` (MPATH:57) of `maxillary premolar` (FMA:55716).', '上颌小臼齿发育不全', '上颌小臼齿发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111970', 'HP:0011053', 'Agenesis of mandibular premolar', '`Agenesis` (MPATH:57) of `mandibular premolar` (FMA:55717).', '下颌小臼齿发育不全', '下颌小臼齿发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111971', 'HP:0011054', 'Agenesis of molar', '`Agenesis` (MPATH:57) of `molar tooth` (FMA:55638).', '大臼齿发育不全', '大臼齿发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111972', 'HP:0011055', 'Agenesis of permanent molar', '`Agenesis` (MPATH:57) of `secondary molar tooth` (FMA:84207).', '恒大臼齿发育不全', '恒大臼齿发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111973', 'HP:0011058', 'Generalized periodontitis', 'A generalized form of `periodontitis` (HP:0000165).', '泛发性牙周炎', '一种泛发性的牙周炎。');
INSERT INTO `fudan_hpos` VALUES ('111974', 'HP:0011059', 'Localized periodontitis', 'A `localized` (PATO:0000627) form of `periodontitis` (HP:0000165).', '局部牙周炎', '局部性的牙周炎。');
INSERT INTO `fudan_hpos` VALUES ('111975', 'HP:0011061', 'Abnormality of dental structure', 'An abnormality of the structure or composition of the teeth.', '牙齿结构异常', '牙齿的结构或组成的异常。');
INSERT INTO `fudan_hpos` VALUES ('111976', 'HP:0011062', 'Misalignment of incisors', '`Misaligned` (PATO:0001654) `incisor` (FMA:12823).', '切牙不齐', '切牙排列不齐。');
INSERT INTO `fudan_hpos` VALUES ('111977', 'HP:0011063', 'Abnormality of incisor morphology', 'An abnormality of `morphology` (PATO:0000051) of the `incisor tooth` (FMA:12823).', '切牙形态异常', '切牙形态的异常。');
INSERT INTO `fudan_hpos` VALUES ('111978', 'HP:0011064', 'Abnormal number of incisors', 'The presence of an `altered number of` of the `incisor teeth`', '切牙数目异常', '存在切牙的数目改变。');
INSERT INTO `fudan_hpos` VALUES ('111979', 'HP:0011065', 'Conical incisor', 'An abnormal `conical` (PATO:0002021) morphology of the `incisor tooth` (FMA:12823).', '圆锥形切牙', '不正常的圆锥形形态的切牙。');
INSERT INTO `fudan_hpos` VALUES ('111980', 'HP:0011067', 'Mesiodens', 'The presence of a supernumerary tooth in the midline between the maxillary central incisors.', '正中冗牙', '上颌中切牙之间的中线上存在多余牙齿。');
INSERT INTO `fudan_hpos` VALUES ('111981', 'HP:0011068', 'Odontoma', 'The presence of an `odontoma` (MPATH:387).', '牙瘤', '有牙瘤。');
INSERT INTO `fudan_hpos` VALUES ('111982', 'HP:0011069', 'Increased number of teeth', 'The presence of a `supernumerary` (PATO:0000470), i.e., extra, `tooth` (FMA:12516) or teeth.', '牙齿数量增加', '有多余的即额外的牙齿。');
INSERT INTO `fudan_hpos` VALUES ('111983', 'HP:0011070', 'Abnormality of molar morphology', 'An abnormality of `morphology` (PATO:0000051) of `molar tooth` (FMA:55638).', '大臼齿形态异常', '大臼齿形态的异常。');
INSERT INTO `fudan_hpos` VALUES ('111984', 'HP:0011071', 'Abnormality of permanent molar morphology', 'An abnormality of `morphology` (PATO:0000051) of `permanent molar` (FMA:84207).', '恒大臼齿形态异常', '恒大臼齿形态的异常。');
INSERT INTO `fudan_hpos` VALUES ('111985', 'HP:0011072', 'Rootless teeth', 'Lack of root of teeth.', '无根牙', '牙齿无牙根。');
INSERT INTO `fudan_hpos` VALUES ('111986', 'HP:0011073', 'Abnormality of dental color', 'A developmental defect of tooth color.', '牙齿颜色异常', '牙齿颜色的发育缺陷。');
INSERT INTO `fudan_hpos` VALUES ('111987', 'HP:0011074', 'Localized hypoplasia of dental enamel', 'A `localized` (PATO:0000627) form of developmental hypoplasia of the `dental enamel` (FMA:55629).', '局部牙釉质发育不全', '局部性的牙釉质发育不全。');
INSERT INTO `fudan_hpos` VALUES ('111988', 'HP:0011075', 'Green teeth', 'A green staining of teeth.', '绿色牙齿', '牙齿被染成绿色。');
INSERT INTO `fudan_hpos` VALUES ('111989', 'HP:0011076', 'Abnormality of premolar', 'An abnormality of `premolar tooth` (FMA:55637).', '恒小臼齿异常', '恒小臼齿的异常。');
INSERT INTO `fudan_hpos` VALUES ('111990', 'HP:0011077', 'Abnormality of molar', 'An abnormality of `molar tooth` (FMA:55638 ).', '大臼齿异常', '大臼齿异常。');
INSERT INTO `fudan_hpos` VALUES ('111991', 'HP:0011078', 'Abnormality of canine', 'An abnormality of `canine tooth` (FMA:55636).', '犬齿异常', '犬齿的异常。');
INSERT INTO `fudan_hpos` VALUES ('111992', 'HP:0011079', 'Impacted tooth', 'A tooth that has not erupted because of local impediments (overcrowding or fibrous gum overgrowth).', '阻生牙', '由于局部障碍（如牙齿过挤或纤维质牙龈过度生长）而未萌出的牙齿。');
INSERT INTO `fudan_hpos` VALUES ('111993', 'HP:0011080', 'Abnormality of premolar morphology', 'An abnormality of `morphology` (PATO:0000051) of `premolar tooth` (FMA:55637).', '恒小臼齿形态异常', '恒小臼齿形态的异常。');
INSERT INTO `fudan_hpos` VALUES ('111994', 'HP:0011081', 'Incisor macrodontia', '`Increased size` (PATO:0000586) of the `incisor tooth` (FMA:12823).', '巨大切牙', '门尺寸增加。');
INSERT INTO `fudan_hpos` VALUES ('111995', 'HP:0011082', 'Conical primary incisor', 'An abnormal `conical` (PATO:0002021) morphology of the primary incisor.', '圆锥形乳切牙', '不正常的圆锥形形态的乳切牙。');
INSERT INTO `fudan_hpos` VALUES ('111996', 'HP:0011084', 'Hypocalcification of dental enamel', 'A form of `hypomineralization of enamel` (HP:0006285) characterized by reduced calcification.', '牙釉质钙化低下', '一种牙釉质矿化不足，其特点是钙化减少。');
INSERT INTO `fudan_hpos` VALUES ('111997', 'HP:0011089', 'Double tooth', 'A dental anomaly characterized by the presence of a two fused teeth.', '双齿', '两颗牙齿融合到一起的牙科异常。');
INSERT INTO `fudan_hpos` VALUES ('111998', 'HP:0011091', 'Gemination', 'The development of two teeth from a single tooth bud, leading to a larger fused tooth.', '重牙', '从单个牙胚发育出两颗牙齿，从而形成一颗更大的稠合齿。');
INSERT INTO `fudan_hpos` VALUES ('111999', 'HP:0011093', 'Molarization of premolar', 'Increased size and molar morphology of `premolar tooth` (FMA:55637).', '小臼齿大臼齿化', '小臼齿尺寸增大变成大臼齿形态。');
INSERT INTO `fudan_hpos` VALUES ('112000', 'HP:0011094', 'Overbite', 'Maxillary teeth cover the mandibular teeth when biting to an increased degree.', '纵向过咬合', '纵向过咬合是指上颌牙齿覆盖下颌齿的纵向咬合程度增加。');
INSERT INTO `fudan_hpos` VALUES ('112001', 'HP:0011107', 'Recurrent aphthous stomatitis', 'Recurrent episodes of ulceration of the oral mucosa.', '复发性阿弗他口腔溃疡', '口腔黏膜溃疡反复发作。');
INSERT INTO `fudan_hpos` VALUES ('112002', 'HP:0011108', 'Recurrent sinusitis', 'A `recurrent` (PATO:0000427) form of `sinusitis` (HP:0000246).', '复发性鼻窦炎', '鼻窦炎反复发作。');
INSERT INTO `fudan_hpos` VALUES ('112003', 'HP:0011109', 'Chronic sinusitis', 'A chronic form of `sinusitis` (HP:0000246).', '慢性鼻窦炎', '一种慢性型的鼻窦炎。');
INSERT INTO `fudan_hpos` VALUES ('112004', 'HP:0011119', 'Abnormality of the nasal dorsum', 'An abnormality of the `nasal dorsum` (FMA:59517), also known as the nasal ridge.', '鼻背异常', '鼻背（亦称鼻嵴）的异常。');
INSERT INTO `fudan_hpos` VALUES ('112005', 'HP:0011120', 'Concave nasal ridge', 'Nasal ridge curving posteriorly to an imaginary line that connects the nasal root and tip.', '凹鼻嵴', '鼻脊向连接鼻根和鼻尖的假想线之后弯曲。');
INSERT INTO `fudan_hpos` VALUES ('112006', 'HP:0011217', 'Abnormal shape of the occiput', 'An `abnormal` (PATO:0000460) `shape` (PATO:0000052) of `occiput` (FMA:49187).', '枕部形态异常', '枕部形状异常。');
INSERT INTO `fudan_hpos` VALUES ('112007', 'HP:0011218', 'Abnormal shape of the frontal region', 'An `abnormal` `shape` of the `frontal part of the head`', '前额部形状异常', '头的前额部位形状异常。');
INSERT INTO `fudan_hpos` VALUES ('112008', 'HP:0011220', 'Prominent forehead', 'Forward prominence of the entire forehead, due to protrusion of the frontal bone.', '前额突出', '由于额骨凸起导致整个前额的向前突出。');
INSERT INTO `fudan_hpos` VALUES ('112009', 'HP:0011223', 'Metopic depression', 'Linear vertical groove in the midline of the forehead, extending from hairline to glabella.', '额头下陷', '在额头中线存在线性纵沟，可从发际线伸展到眉间。');
INSERT INTO `fudan_hpos` VALUES ('112010', 'HP:0011224', 'Ablepharon', 'Absent `eyelids`', '无睑畸形', '没有眼皮。');
INSERT INTO `fudan_hpos` VALUES ('112011', 'HP:0011225', 'Epiblepharon', 'Redundant eyelid skin pressing the eyelashes against the cornea and/or conjunctiva.', '眼睑赘皮', '将睫毛压在角膜和/或结膜的冗余眼睑皮肤。');
INSERT INTO `fudan_hpos` VALUES ('112012', 'HP:0011226', 'aplasia/Hypoplasia affecting the eyelid', 'Absence or underdevelopment of the eyelid.', '眼睑发育不全／未发育', '没有或发育不全的眼睑。');
INSERT INTO `fudan_hpos` VALUES ('112013', 'HP:0011228', 'Horizontal eyebrow', 'An eyebrow that extends straight across the brow, without curve.', '水平眉', '眉毛沿着眉骨水平伸展，没有曲线。');
INSERT INTO `fudan_hpos` VALUES ('112014', 'HP:0011229', 'Broad eyebrow', 'Regional increase in the width (height) of the eyebrow.', '宽眉', '眉的宽度（高度）区域性增加。');
INSERT INTO `fudan_hpos` VALUES ('112015', 'HP:0011315', 'Unicoronal synostosis', 'Synostosis affecting only one of the coronal sutures.', '单侧冠状缝融合', '单侧冠状缝骨性愈合。');
INSERT INTO `fudan_hpos` VALUES ('112016', 'HP:0011316', 'Left unicoronal synostosis', 'Synostosis affecting only the left coronal suture.', '左侧冠状缝融合', '只影响左侧冠状缝的骨性愈合。');
INSERT INTO `fudan_hpos` VALUES ('112017', 'HP:0011317', 'Right unicoronal synostosis', 'Unicoronal synostosis affecting only the right coronal suture.', '右侧冠状缝融合', '只累及右冠状缝的单侧骨性融合。');
INSERT INTO `fudan_hpos` VALUES ('112018', 'HP:0011318', 'Bicoronal synostosis', 'Synostosis affecting the right and the left coronal suture.', '双侧冠状骨缝融合', '右侧和左侧冠状骨缝的愈合。');
INSERT INTO `fudan_hpos` VALUES ('112019', 'HP:0011319', 'Bilambdoid synostosis', 'Premature synostosis of both lambdoid sutures.', '双侧人字骨缝融合', '两侧人字骨缝过早愈合。');
INSERT INTO `fudan_hpos` VALUES ('112020', 'HP:0011320', 'Unilambdoid synostosis', 'Premature synostosis of only one lambdoid suture.', '单侧人字缝融合', '单侧人字缝过早骨性愈合。');
INSERT INTO `fudan_hpos` VALUES ('112021', 'HP:0011321', 'Left unilambdoid synostosis', 'Premature synostosis of only the left lambdoid suture.', '左侧人字缝融合', '只影响左侧人字缝的过早骨性愈合。');
INSERT INTO `fudan_hpos` VALUES ('112022', 'HP:0011322', 'Right unilambdoid synostosis', 'Premature synostosis of only the right lambdoid suture.', '右侧人字缝融合', '右侧人字缝过早融合。');
INSERT INTO `fudan_hpos` VALUES ('112023', 'HP:0011325', 'Pansynostosis', 'Craniosynostosis of all calvarial sutures.', '泛颅缝早闭', '所有颅骨颅缝早闭。');
INSERT INTO `fudan_hpos` VALUES ('112024', 'HP:0011326', 'Anterior plagiocephaly', 'Asymmetry of the anterior part of the skull.', '前斜头畸形', '前部头骨不对称。');
INSERT INTO `fudan_hpos` VALUES ('112025', 'HP:0011327', 'Posterior plagiocephaly', 'Asymmetry of the posterior part of the skull.', '后斜头畸形', '不对称的头骨后部的。');
INSERT INTO `fudan_hpos` VALUES ('112026', 'HP:0011328', 'Abnormality of fontanelles', 'An abnormality of the `fontanelle` (FMA:75438).', '囟门异常', '囟门的异常。');
INSERT INTO `fudan_hpos` VALUES ('112027', 'HP:0011330', 'Metopic synostosis', 'Premature fusion of the metopic suture.', '额骨缝早闭', '额骨缝合过早融合。');
INSERT INTO `fudan_hpos` VALUES ('112028', 'HP:0011331', 'Hemifacial atrophy', 'Unilateral atrophy of facial tissues, including muscles, bones and skin.', '半面肌萎缩', '单侧面部组织包括肌肉、骨骼和皮肤的萎缩。');
INSERT INTO `fudan_hpos` VALUES ('112029', 'HP:0011332', 'Hemifacial hypoplasia', 'Unilateral underdevelopment of the facial tissues, including muscles and bones.', '面肌发育不全', '单侧面部组织包括肌肉和骨骼的发育不全。');
INSERT INTO `fudan_hpos` VALUES ('112030', 'HP:0011334', 'Facial shape deformation', '#####', '脸变形', '#####');
INSERT INTO `fudan_hpos` VALUES ('112031', 'HP:0011335', 'Frontal hirsutism', 'Excessive amount of hair growth on forehead.', '正面多毛症', '前额头发的过量生长。');
INSERT INTO `fudan_hpos` VALUES ('112032', 'HP:0011336', 'Bitemporal forceps marks', 'Bilateral temporal scarlike defects, which are said to resemble forceps marks.', '双颞钳痕', '双侧颞伤痕般缺陷，类似钳子夹过的痕迹。');
INSERT INTO `fudan_hpos` VALUES ('112033', 'HP:0011337', 'Abnormality of mouth size', '#####', '嘴巴大小异常', '#####');
INSERT INTO `fudan_hpos` VALUES ('112034', 'HP:0011338', 'Abnormality of mouth shape', 'An abnormality of the outline, configuration, or contour of the mouth.', '嘴形异常', '嘴巴轮廓的异常。');
INSERT INTO `fudan_hpos` VALUES ('112035', 'HP:0011340', 'Incomplete cleft of the upper lip', 'A subtle unilateral cleft of the upper lip, which may appear as a small indentation.', '上唇不完全唇裂', '上唇的微小单侧唇裂，可能会表现为一个小缺口。');
INSERT INTO `fudan_hpos` VALUES ('112036', 'HP:0011341', 'Long upper lip', 'Increased width of the `upper lip` (FMA:59817).', '长上唇', '上唇的宽度增加。');
INSERT INTO `fudan_hpos` VALUES ('112037', 'HP:0011451', 'Congenital microcephaly', 'Microcephaly (HP:0000252) that is present already at the time of birth.', '先天性小头畸形', '出生时已存在的小头畸形。');
INSERT INTO `fudan_hpos` VALUES ('112038', 'HP:0011457', 'Loss of eyelashes', 'This term refers to the loss of eyelashes that were previously present.', '睫毛退失', '这个术语是指睫毛先前存在后来消退至无。');
INSERT INTO `fudan_hpos` VALUES ('112039', 'HP:0011480', 'Unilateral microphthalmos', 'A developmental anomaly characterized by abnormal smallness of one eye.', '单侧小眼畸形', '一种单侧眼睛发育过小的生长畸形。');
INSERT INTO `fudan_hpos` VALUES ('112040', 'HP:0011799', 'Abnormality of facial soft tissue', '#####', '面部软组织异常', '#####');
INSERT INTO `fudan_hpos` VALUES ('112041', 'HP:0011801', 'Enlargement of parotid gland', 'Increased size of the parotid gland.', '腮腺肿大', '腮腺变大。');
INSERT INTO `fudan_hpos` VALUES ('112042', 'HP:0011802', 'Hamartoma of tongue', '#####', '舌头错构瘤', '#####');
INSERT INTO `fudan_hpos` VALUES ('112043', 'HP:0011803', 'Bifid nose', 'Visually assessable vertical indentation, cleft, or depression of the nasal bridge, ridge and tip.', '鼻裂', '目视可见的垂直压痕，裂开，或凹陷的鼻梁，鼻脊和鼻尖。');
INSERT INTO `fudan_hpos` VALUES ('112044', 'HP:0011816', 'Parietal encephalocele', 'An encephalocele located between bregma and lambda.', '顶叶脑膨出', '位于前囟和人字缝与矢状缝交界处之间的脑膨出。');
INSERT INTO `fudan_hpos` VALUES ('112045', 'HP:0011818', 'Nasofrontal encephalocele', '#####', '鼻额脑膨出', '#####');
INSERT INTO `fudan_hpos` VALUES ('112046', 'HP:0011821', 'Abnormality of facial skeleton', 'An abnormality of one or more of the set of bones that make up the `facial skeleton` (FMA:53673).', '面部骨骼异常', '面部骨骼中一块或多块骨头的异常。');
INSERT INTO `fudan_hpos` VALUES ('112047', 'HP:0011822', 'Broad chin', 'Increased width of the midpoint of the mandible (mental protuberance) and overlying soft tissue.', '宽下巴', '下颌骨（心理突起）和上覆的软组织中点的宽度增加。');
INSERT INTO `fudan_hpos` VALUES ('112048', 'HP:0011824', 'Chin with H-shaped crease', 'H-shaped crease in the fat pad of the chin.', '有H形折痕的下巴', '下巴脂肪垫H形折痕。');
INSERT INTO `fudan_hpos` VALUES ('112049', 'HP:0011825', 'Tented philtrum', 'Prominence of a triangular soft tissue area of the philtrum with the apex to the columella.', '帐篷型人中', '从鼻柱至上唇尖的软组织区呈一三角形。');
INSERT INTO `fudan_hpos` VALUES ('112050', 'HP:0011826', 'Philtrum with midline raphe', 'Narrow ridge in the midline of the philtral groove.', '人中有中线缝', '窄脊在人中槽的中线。');
