INSERT INTO `fudan_hpos` VALUES ('112053', 'HP:0011830', 'Abnormality of oral mucosa', 'Abnormality of the `oral mucosa` (FMA:59660).', '口腔黏膜异常', '口腔黏膜的异常。');
INSERT INTO `fudan_hpos` VALUES ('112054', 'HP:0011831', 'Deviated nasal tip', 'Nasal tip positioned to one side of the midline.', '鼻尖偏离', '鼻尖位于中线的某一侧。');
