INSERT INTO `fudan_hpos` VALUES ('112060', 'HP:0012247', 'Specific anosmia', 'Anosmia for one particular odor.', '特定嗅觉丧失', '某种特定的嗅觉缺失。');
INSERT INTO `fudan_hpos` VALUES ('112061', 'HP:0012292', 'Fusion of gums', 'A congenital defect with an abnormal joining of the gums of the upper and lower jaw.', '牙龈融合', '上下颌骨牙龈异常融合的先天性畸形。');
INSERT INTO `fudan_hpos` VALUES ('112062', 'HP:0012294', 'Abnormality of the occipital bone', 'Abnormality of the `occipital bone` (FMA:52735) of the skull.', '枕骨异常', '枕骨的异常');
INSERT INTO `fudan_hpos` VALUES ('112063', 'HP:0012328', 'Cementoma', 'An odontogenic tumor of the `cementum of tooth` (FMA:55630).', '牙骨质瘤', '牙骨质的牙源性肿瘤。');
INSERT INTO `fudan_hpos` VALUES ('112064', 'HP:0012368', 'Flat face', 'Absence of concavity or convexity of the face when viewed in profile.', '扁平脸', '从侧面看时面部缺乏凹凸感。');
