INSERT INTO `fudan_hpos` VALUES ('112069', 'HP:0012413', 'Notched primary central incisor', 'The presence of a V-shaped indentation (notch) in the primary central incisor.', '乳中切牙缺口', '乳中切牙上存在一个V形凹口（缺口）。');
INSERT INTO `fudan_hpos` VALUES ('112070', 'HP:0012471', 'Thick vermilion border', 'Increased width of the \"skin of vermilion border region of upper lip\" (FMA:312645).', '厚嘴唇', '上唇唇红区皮肤明显增宽。');
INSERT INTO `fudan_hpos` VALUES ('112071', 'HP:0012472', 'Eclabion', 'A turning outward of the lip or lips, that is, eversion of the lips.', '唇外翻', '向外翻出的嘴唇，嘴唇外翻。');
INSERT INTO `fudan_hpos` VALUES ('112072', 'HP:0012473', 'Tongue atrophy', 'Wasting of the `tongue` (FMA:54640).', '舌萎缩', '舌头虚痨。');
INSERT INTO `fudan_hpos` VALUES ('112073', 'HP:0012478', 'Temporomandibular joint ankylosis', 'Fusion of the mandibular condyle to the base of the skull, resulting in limitation of jaw opening.', '颞下颌关节强直', '下颌骨髁突与颅底融合，造成张口受限。');
INSERT INTO `fudan_hpos` VALUES ('112074', 'HP:0012549', 'Conjunctival lipoma', 'A lipoma (a benign tumor composed of adipose tissue) located in the conjunctiva.', '结膜脂肪瘤', '位于结膜上的脂肪瘤（良性肿瘤脂肪组织组成）。');
INSERT INTO `fudan_hpos` VALUES ('112075', 'HP:0012568', 'Lower eyelid edema', 'Edema in the region of the `Lower eyelid` (FMA:54442).', '下眼睑浮肿', '下眼睑区域浮肿。');
INSERT INTO `fudan_hpos` VALUES ('112076', 'HP:0012720', 'Neoplasm of the nose', 'Cancer of the nasal cavity.', '鼻腔肿瘤', '鼻腔的肿瘤。');
