INSERT INTO `fudan_hpos` VALUES ('112078', 'HP:0012730', 'Aglossia', 'Absence of the tongue owing to a developmental abnormality.', '无舌畸形', '由于发育异常造成缺乏舌头。');
INSERT INTO `fudan_hpos` VALUES ('112079', 'HP:0012738', 'Agenesis of canine', '`Agenesis` (MPATH:57) of `canine tooth` (FMA:55636).', '犬齿发育不全', '犬齿发育不全。');
INSERT INTO `fudan_hpos` VALUES ('112080', 'HP:0012778', 'Retinal astrocytic hamartoma', 'A glial tumor of the retinal nerve fiber layer arising from a retinal astrocyte.', '视网膜星形细胞错构瘤', '从视网膜胶质细胞引起的视网膜神经纤维层的胶质细胞瘤。');
INSERT INTO `fudan_hpos` VALUES ('112081', 'HP:0012788', 'Reticulate pigmentation of oral mucosa', 'A net-like pattern of increased pigmentation of the oral cavity.', '口腔黏膜网状色素沉着', '口腔网状图案色素沉着增加。');
INSERT INTO `fudan_hpos` VALUES ('112082', 'HP:0012799', 'Unilateral facial palsy', 'One-sided weakness of the muscles of facial expression and eye closure.', '单侧面神经麻痹', '单侧面部表情和闭合眼睛的肌肉张力减低。');
INSERT INTO `fudan_hpos` VALUES ('112083', 'HP:0012807', 'High insertion of columella', 'Insertion of the posterior columella superior to the nasal base.', '鼻小柱高插入', '后鼻小柱插入于鼻基之上。');
INSERT INTO `fudan_hpos` VALUES ('112084', 'HP:0012809', 'Narrow nasal base', 'Decreased distance between the attachments of the alae nasi to the face.', '鼻基狭窄', '连到面部的鼻翼之间距离减小。');
INSERT INTO `fudan_hpos` VALUES ('112085', 'HP:0012810', 'Wide nasal base', 'Increased distance between the attachments of the alae nasi to the face.', '宽鼻基', '鼻翼与皮肤附着处两侧之间的距离增加。');
