INSERT INTO `fudan_hpos` VALUES ('112089', 'HP:0012893', 'Neck muscle hypertrophy', 'Muscle hypertrophy affecting the muscles of the neck.', '颈部肌肉肥大', '肌肥大影响颈部肌肉。');
