INSERT INTO `fudan_hpos` VALUES ('112091', 'HP:0030001', 'Lagopthalmos', 'A condition in which the eyelids do not close to cover the eye completely.', '睑裂闭合不全', '指眼睑不能完全遮住眼睛的情况。');
INSERT INTO `fudan_hpos` VALUES ('112092', 'HP:0030002', 'Nocturnal lagophthalmos', 'The inability to close the eyelids during sleep.', '夜间睑裂闭合不全', '夜间睡眠时眼睑不能闭合。');
INSERT INTO `fudan_hpos` VALUES ('112093', 'HP:0030003', 'Paralytic lagophthalmos', 'A type of lagophthalmos that occurs in association with facial nerve palsy.', '麻痹性睑裂闭合不全', '与面神经麻痹相关的一类眼球炎。');
INSERT INTO `fudan_hpos` VALUES ('112094', 'HP:0030004', 'Cicatricial lagophthalmos', 'A type of lagophthalmos that occurs following trauma or surgery.', '瘢痕性睑裂闭合不全', '创伤或手术后发生的一类眼刺激。');
