INSERT INTO `fudan_hpos` VALUES ('112103', 'HP:0030413', 'Squamous cell carcinoma of the tongue', 'A carcinoma derived from a squamous epithelial cell of the tongue.', '舌鳞状细胞癌', '源自舌鳞状上皮细胞的癌。');
