INSERT INTO `fudan_hpos` VALUES ('112108', 'HP:0030690', 'Gingival cleft', 'A fissure in the gingiva (gums), i.e., the mucosal tissue that lies over the mandible and maxilla.', '牙龈裂', '牙龈（牙龈）中的裂缝，如位于下颌骨和上颌骨上的粘膜组织的裂缝。');
