INSERT INTO `fudan_hpos` VALUES ('112321', 'HP:0000741', 'Apathy', 'Lack of emotion or emotional expression; a disorder of motivation that persists over time.', '情感淡漠', '缺乏感情或情绪的表达；一种持续性动力障碍的一种疾病。');
