INSERT INTO `fudan_hpos` VALUES ('112370', 'HP:0001342', 'Cerebral hemorrhage', '`Hemorrhage` (MPATH:119) into the parenchyma of the `brain` (FMA:50801).', '脑出血', '脑实质（FMA:50801）的出血(MPATH:119)。');
