INSERT INTO `fudan_hpos` VALUES ('115025', 'HP:0430025', 'Bilateral facial palsy', 'Two-sided or bilateral weakness of the muscles of facial expression and eye closure.', '双侧面瘫', '是以双侧面部表情肌群运动功能障碍为主要特征的一种疾病。一般表现为面部表情肌瘫痪，前额皱纹消失、口眼歪斜。不能做皱额、蹙眉、闭目、鼓气和噘嘴等动作。');
INSERT INTO `fudan_hpos` VALUES ('115026', 'HP:0004349', 'Reduced bone mineral density', 'A reduction of bone mineral density, that is, of the amount of matter per cubic centimeter of bones.', '骨密度降低', '骨密度（每立方厘米骨头的量）降低。');
INSERT INTO `fudan_hpos` VALUES ('115027', 'HP:0004380', 'Aortic valve calcification', 'Deposition of calcium salts in the aortic valve.', '主动脉瓣钙化', '钙盐在主动脉瓣沉积。');
