INSERT INTO `fudan_hpos` VALUES ('115030', 'HP:3000047', 'Abnormality of glossopharyngeal nerve', 'An abnormality of a glossopharyngeal nerve.', '舌咽神经异常', '舌咽神经为混合神经，是舌咽部重要的感觉传入神经，其损伤多由颅后窝颈静脉孔区病变极易引起。表现为患侧舌后1/3的味觉减低或消失，咽上部一般感觉减低或丧失，软腭下垂。');
INSERT INTO `fudan_hpos` VALUES ('115031', 'HP:0004423', 'Cranium bifidum occultum', '#####', '隐性颅裂', '#####');
INSERT INTO `fudan_hpos` VALUES ('115032', 'HP:3000048', 'Abnormality of great auricular nerve', 'An abnormality of a great auricular nerve.', '耳大神经异常', '耳大神经起于第二、第三颈神经，为颈丛皮支中最大的分支。主要分布于腮腺、嚼肌下部、耳垂、耳廓后和乳突部的皮肤。耳大神经被损伤后，这些部位的皮肤即有麻木感。');
INSERT INTO `fudan_hpos` VALUES ('115033', 'HP:0004437', 'Cranial hyperostosis', 'Excessive growth of the `bones of cranium` (FMA:71325), i.e., of the skull.', '颅骨骨质增生', '颅骨（即头骨）过度生长');
INSERT INTO `fudan_hpos` VALUES ('115034', 'HP:0004438', 'Hyperostosis frontalis interna', 'Bony overgrowth of the internal (endosteal) surface of the `frontal bone` (FMA:52734).', '额骨内板增生症', '额骨（FMA:52734）的内侧（内膜）面发生骨性增生。');
INSERT INTO `fudan_hpos` VALUES ('115035', 'HP:3000055', 'Abnormality of inferior alveolar nerve', 'An abnormality of an inferior alveolar nerve.', '下牙槽神经异常', '下牙槽神经损伤是下颌智齿拔除术后或下颌骨损伤比较严重的并发症之一，常引起下牙感觉异常。');
INSERT INTO `fudan_hpos` VALUES ('115036', 'HP:0004439', 'Craniofacial dysostosis', 'A characteristic appearance resulting from defective ossification of craniofacial bones.', '颅面骨发育不全', '颅面骨的骨化缺陷造成的特征性的外观');
INSERT INTO `fudan_hpos` VALUES ('115037', 'HP:3000061', 'Abnormality of infra-orbital nerve', 'An abnormality of an infra-orbital nerve.', '眶下神经异常', '眶下神经为上颌神经的终支，通过眶下沟、眶下管、出眶下孔至面部，分为数支分布于下睑、鼻翼和上唇的皮肤、粘膜。其损伤多见于眶底骨折, 表现多为同侧下睑中部,鼻翼皮肤、上唇皮肤和黏膜的感觉异常。');
INSERT INTO `fudan_hpos` VALUES ('115038', 'HP:3000075', 'Abnormality of lingual nerve', 'An abnormality of a lingual nerve.', '舌神经异常', '舌神经异常是由于舌神经损伤所导致的暂时性或永久性的同侧前2/3的舌体麻木和味觉障碍。');
INSERT INTO `fudan_hpos` VALUES ('115039', 'HP:0004440', 'Coronal craniosynostosis', 'Premature closure of the `coronal suture of skull` (FMA:52928).', '冠状缝早闭', '颅骨冠状缝过早闭合');
